import React from 'react';

const resposta = {
  data: ['This', 'is', 'a', 'map']
}

class EasyMap extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      lista: [],
    };
    this.mapGenerate = this.mapGenerate.bind(this);
  }

  componentDidMount() {
    this.setState({
      lista: resposta.data,
    });
    console.log(this.state.lista)
  }

  mapGenerate() {
    return this.state.lista.map(index => <p key={index}>{index}</p>
    );
  }

  render() {
    return (
      <div>
        {this.mapGenerate}
      </div>
    );
  }
}

export default EasyMap;
